import React from 'react';
import FadeIn from 'react-fade-in';
import amani_pic from '../media/amani.jpg';
import "../styles/home.css";

const Home = () => {
  return (
    <div id="home-div">
      <h1>About</h1>
      <div id="intro-div">
        <div>
          <p>I am an incoming PhD student at MIT Brain & Cognitive Sciences, where I will research cognition by studying human and artificial intelligence in tandem. I am excited about using artificial intelligence as a scientific tool to study how the mind works, and using what we know about the mind to develop more cognitively-realistic models. My work is supported by a School of Science Dean's Fellowship.</p>
          <p>I graduate with high distinction from Harvey Mudd College in 2023.</p>
        </div>
        <img id="amani-pic" src={amani_pic}/>
      </div>
    </div>
  );
}

export default Home;
